import React from 'react'
import './Repositories.css'
import {useSelector} from "react-redux";


export const Repositories = () => {
    const state = useSelector(state => state.user)
    console.log(state)

    let pageCount = Math.ceil(state.user.public_repos / 4)
    let pages = []
    for (let i = 1; i <= pageCount; i++) {
        pages.push(i)
    }
    console.log(pages)
    return (
        <div className=''>
            <div>Repositories({state ? state.user.public_repos : ''})</div>
            {state.repo.map(repo => {
                return (
                    <div className='repo'>
                        <div>{repo.name}</div>
                        <div>{repo.description}</div>
                    </div>
                )
            })}
            {pages.map(page => {
                return <span onClick={() => console.log(page)}>{page}</span>
            })

            }
        </div>
    )
}
